import React from 'react';
import "./../node_modules/bootstrap/dist/css/bootstrap.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import './assets/css/style.css';
import './App.css';
import Routes from './component/routes/Routes';

function App() {
  return (
    <div className="App">
      <Routes />
    </div>
  );
}

export default App;
